var Main = Main || {};

Main.Preload = function(){};

Main.Preload.prototype = {
    preload: function(){
        //load all assets to cache and go to menu state
		this.imageToURI();
        this.game.load.image('bg', this.bg);
        this.game.load.image('full', this.full);
        this.game.load.image('third', this.third);
        this.game.load.image('twothird', this.twothird);
        this.game.load.image('dead', this.dead);
        this.game.load.image('menu', this.menu);
        this.game.load.image('score', this.score);
        this.game.load.image('namebg', this.namebg);
        this.game.load.image('table', this.table);
        this.game.load.spritesheet('btn', this.btn, 200, 100);
        this.game.load.spritesheet('btn2', this.btn2, 150, 100);
        this.game.load.image('ship1', this.ship1);
        this.game.load.image('ship2', this.ship2);
        this.game.load.image('enemy1', this.enemy1);
        this.game.load.image('enemy2', this.enemy2);
        this.game.load.image('laser1', this.laser1);
        this.game.load.image('laser2', this.laser2);
        this.game.state.start("Menu");
		
    },
	
	imageToURI: function(){
		this.bg = "data:image/png;base64,";
		this.full = "data:image/png;base64,";
		this.third = "data:image/png;base64,";
		this.twothird = "data:image/png;base64,";
		this.dead = "data:image/png;base64,";
		this.menu = "data:image/png;base64,";
		this.score = "data:image/png;base64,";
		this.namebg = "data:image/png;base64,";
		this.table = "data:image/png;base64,";
		this.btn = "data:image/png;base64,";
		this.btn2 = "data:image/png;base64,";
		this.ship1 = "data:image/png;base64,";
		this.ship2 = "data:image/png;base64,";
		this.enemy1 = "data:image/png;base64,";
		this.enemy2 = "data:image/png;base64,";
		this.laser1 = "data:image/png;base64,";
		this.laser2 = "data:image/png;base64,";
		
	}
};